import React from 'react';
import { Col, Row, Button, Form, FormGroup, Label, Input, FormText, ListGroup, ListGroupItem } from 'reactstrap';

export default class Example extends React.Component {

  constructor (props){
    super(props);
    this.state={
      songsForPlaylist: [],
      isloaded: false,

    }
  }

  componentDidMount(){
    fetch('https://se3309-final-project-amali28.c9users.io:8081/retrievePlaylistSongs')
    .then(res=> res.json())
    .then(json => {
   this.setState({
        isloaded: true,
        songsForPlaylist: json,
      })
    });
  }


  render() {
    var{isloaded, songsForPlaylist} = this.state;

    return (

      <Form>
        <Row form>
          <Col md={6}>
            <FormGroup>
              <Label for="Playlist">Create a Playlist</Label>
              <Input type="text" name="Playlist" id="exampleEmail" placeholder="Enter playlist name..." />
            </FormGroup>
          </Col>
        </Row>
        <ListGroup stylename= "songNames">
          {songsForPlaylist.map (songs => (
	          <ListGroupItem key = {songs.id}> 
		        {songs.songName}
            	</ListGroupItem>
        ))};

        </ListGroup>
        <Button id="createPlaylist">Create</Button>
      </Form>
    );



  }
  retrieveSongs() {

  }
}
